insert  into `oa_notify`(`id`,`type`,`title`,`content`,`files`,`status`,`column_id`,`remarks`,`del_flag`,`create_by`,`create_date`,`update_by`,`update_date`,`publish_time`,`school_id`) values ('81',NULL,'武汉市测试学校“最具亲和力教师”评选办法','<p class=\"MsoNormal\" style=\"text-indent: 32.0pt; mso-char-indent-count: 2.0;\"><span lang=\"EN-US\" style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">&ldquo;</span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">给学生最美好的童年，给人生最坚实的起步<span lang=\"EN-US\">&rdquo;</span>是武汉测试学校率先明确提出的办学理念，落实学校<span lang=\"EN-US\">&ldquo;</span>两给<span lang=\"EN-US\">&rdquo;</span>办学理念，创设学校<span lang=\"EN-US\">&ldquo;</span>幸福教育<span lang=\"EN-US\">&rdquo;</span>，教师是根本。为了进一步调动广大教师的积极性，客观公正地评价教师的工作业绩，学校把评选<span lang=\"EN-US\">&ldquo;</span>最具亲和力教师<span lang=\"EN-US\">&rdquo;</span>工作作为促进学校内涵发展的内容之一，为此，特制定《武汉测试学校<span lang=\"EN-US\">&ldquo;</span>最具亲和力教师<span lang=\"EN-US\">&rdquo;</span>评选办法》。</span></p>\n<p class=\"MsoNormal\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">一、评选条件：</span></p>\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">&nbsp;&nbsp;&nbsp; </span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">遵照《武汉测试学校<span lang=\"EN-US\">&ldquo;</span>最具亲和力教师<span lang=\"EN-US\">&rdquo;</span>评选条件》评选。</span></p>\n<p class=\"MsoNormal\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">二、评选对象：</span></p>\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">1</span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">、在学校工作两年以上的在职在编以及聘用教师均可参评。每届评选<span lang=\"EN-US\">&ldquo;</span>最具亲和力教师<span lang=\"EN-US\">&rdquo;</span>称号教师<span lang=\"EN-US\">12</span>人，评选<span lang=\"EN-US\">&ldquo;</span>具亲和力教师<span lang=\"EN-US\">&rdquo;</span>称号教师<span lang=\"EN-US\">15</span>人。评选时充分认可各学科教师团队的整体发展，对学校语文、数学、综合学科教师客观评价。</span></p>\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">2</span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">、自上届评比后至本届申报评选的两年时间以内，凡出现以下情况之一者，取消申报资格：（<span lang=\"EN-US\">1</span>）有师德问题，调查核实者。（<span lang=\"EN-US\">2</span>）年度考核基本称职或不合格者。（<span lang=\"EN-US\">3</span>）发生教育教学事故者。（<span lang=\"EN-US\">4</span>）累计年病假一个月以上、累计事假<span lang=\"EN-US\">5</span>天（学校机动假票不含在内）以上者。</span></p>\n<p class=\"MsoNormal\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">三、评选原则：</span></p>\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">1</span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">、遵循公平、公正、公开原则评选，透明操作，民主管理。</span></p>\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">2</span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">、两年一届，双年度评选，实行业绩审报，动态管理。可每届连续参评。</span></p>\n<p class=\"MsoNormal\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">四、评选程序：</span></p>\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">&nbsp;&nbsp;&nbsp; 1</span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">、建立评审小组。学校建立年度<span lang=\"EN-US\">&ldquo;</span>最具亲和力教师<span lang=\"EN-US\">&rdquo;</span>工作评审小组。小组成员兼顾学科教师平衡，充分吸纳组长、各类学科带头人、工作室成员的代表入选评审小组。评审小组成员由学校行政会、校务会最终审定。</span></p>\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">&nbsp;&nbsp;&nbsp; 2</span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">、教师自主申报。符合条件的教师自主申报并填写武汉测试学校<span lang=\"EN-US\">&ldquo;</span>最具亲和力教师<span lang=\"EN-US\">&rdquo;</span>申请表，并上交个人优秀事迹材料和有关印证材料。</span></p>\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">&nbsp;&nbsp;&nbsp; 3</span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">、评审小组初步审核。由学校评审小组对材料进行严格审核并确定符合条件的参评人选，并综合确定初步候选人。候选人<span lang=\"EN-US\">&ldquo;</span>最具亲和力教师<span lang=\"EN-US\">&rdquo;14</span>人，<span lang=\"EN-US\">&ldquo;</span>具亲和力教师<span lang=\"EN-US\">&rdquo;17</span>人。</span></p>\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">&nbsp;&nbsp;&nbsp; 4</span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">、组织测评。对初步候选人组织民主测评，参加测评人员为学校教职工、候选人所任班级学生和家长代表。测评结果作为确定人选的重要依据。</span></p>\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">&nbsp;&nbsp;&nbsp; 5</span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">、综合考评确定人选。学校评审小组再次根据教师申请材料、组织测评结果等进行最后评定，确定<span lang=\"EN-US\">&ldquo;</span>最具亲和力教师<span lang=\"EN-US\">&rdquo;</span>称号<span lang=\"EN-US\">12</span>人，<span lang=\"EN-US\">&ldquo;</span>具亲和力教师<span lang=\"EN-US\">&rdquo;</span>称号<span lang=\"EN-US\">15</span>人。</span></p>\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">&nbsp;&nbsp;&nbsp; 6</span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">、公示并表彰。学校将最终评选出的结果在校务公开栏公示一周，公示期满无异议者当选并给予表彰，由学校党政工对获得<span lang=\"EN-US\">&ldquo;</span>最具亲和力教师<span lang=\"EN-US\">&rdquo; &ldquo;</span>具亲和力教师<span lang=\"EN-US\">&rdquo;</span>荣誉称号的教师联合颁发荣誉证书，在学校校园网上积极宣传获奖教师优秀事迹。公示期如有异议者，学校将会同评审小组按有关程序处理。</span></p>\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">&nbsp;&nbsp;&nbsp; 7</span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">、在各级各类学习培训中，对获得<span lang=\"EN-US\">&ldquo;</span>最具亲和力教师<span lang=\"EN-US\">&rdquo; &ldquo;</span>具亲和力教师<span lang=\"EN-US\">&rdquo;</span>进行优先安排，提供更多机会参加高层次学习培训。</span></p>\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">&nbsp;&nbsp;&nbsp; 8</span><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">、获奖教师的评选材料存入教师档案，在教师岗位设置、评先评优中作为重要参考依据。</span></p>\n<p class=\"MsoNormal\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">本评选办法自颁布之日起实施。</span></p>\n<p class=\"MsoNormal\" style=\"text-indent: 304.0pt; mso-char-indent-count: 19.0;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;武汉测试学校</span></p>\n<p>&nbsp;</p>\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 16.0pt; mso-bidi-font-size: 11.0pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2016.11.25</span></p>',',/opt/platform/vfsroot/notify/attach/1480060339355武汉测试学校“最具亲和力教师”评选办法.docx',NULL,'38',NULL,0,'690',1480060341233,'690',1480060341233,1480060341217,'37'),('82',NULL,'关于开展江岸区教育局第三期“特级教师课堂”高级研修工作的通知','<p style=\"word-wrap: break-word; margin: 0px; padding: 0px; border: 0px; color: #666666; font-family: 宋体, Arial; font-size: 14px; background-color: #eeeeee;\">&nbsp; 为贯彻落实江岸区教育局十二五规划中&ldquo;现代教育人才建设工程&rdquo;有关精神，切实加强骨干教师队伍建设，培养适应江岸教育现代化需要的名师，着力打造一批能够引领全区教育改革与发展，在全省有一定影响的专家型教师，提升我区中小学教师队伍整体水平，促进我区基础教育的均衡发展，江岸区教育局决定启动&ldquo;骨干教师领航计划&rdquo;，举办第三期&ldquo;特级教师课堂&rdquo;高级研修班，通过对本区申报参评 &ldquo;特级教师&rdquo;的骨干教师进行提高性培训，进一步提高其专业化水平，为骨干教师成长助力。现就有关工作通知如下：<br style=\"word-wrap: break-word;\" />一、&nbsp;研修方式<br style=\"word-wrap: break-word;\" />&nbsp; 第三期&ldquo;特级教师课堂&rdquo;高级研修工作采取理论研修和实践研修相结合的方式进行。其中：<br style=\"word-wrap: break-word;\" />理论研修：邀请知名专家学者进行专题讲座、个人专业研读。<br style=\"word-wrap: break-word;\" />实践研修:研修教师和区内发展中学校的教师师徒结对，通过专业引<br style=\"word-wrap: break-word;\" />领、合作交流、同伴互助等方式开展研修工作，发挥骨干教师的引领与辐射作用，和发展中学校教师共同成长。<br style=\"word-wrap: break-word;\" />二、&nbsp;研修人员条件<br style=\"word-wrap: break-word;\" />&nbsp; &ldquo;特级教师课堂&rdquo;高级研修班的研修人员为具备申报省特级教师条件的在职中小学教师（含幼儿园），男教师在55岁以下，女教师50岁以下（湖北省特级教师评选条件见附件3）。<br style=\"word-wrap: break-word;\" />三、研修人员遴选方式：<br style=\"word-wrap: break-word;\" />&nbsp; 区属各中小学需要参评&ldquo;湖北省特级教师&rdquo;的教师自愿报名，并由所属学校推荐，区教育局综合考核，最后确定研修人员名单（研修名额 30人）。<br style=\"word-wrap: break-word;\" />四、&nbsp;材料报送<br style=\"word-wrap: break-word;\" />（一）申请人于2013年11月15日前，将申请纸质材料（附件1、附件2所列材料）上报江岸区教师进修学校，将附件1的电子文档发送至<a style=\"word-wrap: break-word; color: #555555; text-decoration: none;\" href=\"mailto:whjajx@126.com\">whjajx@126.com</a>。<br style=\"word-wrap: break-word;\" />（二）申请人均需在综合考核时提供有关证明材料的原件。<br style=\"word-wrap: break-word;\" />五、&nbsp;工作要求<br style=\"word-wrap: break-word;\" />（一）各校进行广泛宣传，积极动员和支持骨干教师参与研修工作，并认真开展研修人员的推荐工作。<br style=\"word-wrap: break-word;\" />（二）申请参加研修工作的教师应严格按照条件认真填写申请推荐表，如实提交业绩资料，不得弄虚作假。<br style=\"word-wrap: break-word;\" />（三）教育局相关部门要认真组织遴选工作，精心选聘专家，科学设计遴选环节，严密监控遴选过程，做到公平、公正、公开，确保遴选出的研修人员得到广泛认可。</p>\n<p style=\"word-wrap: break-word; margin: 0px; padding: 0px; border: 0px; color: #666666; font-family: 宋体, Arial; font-size: 14px; background-color: #eeeeee;\">&nbsp;</p>\n<p style=\"word-wrap: break-word; margin: 0px; padding: 0px; border: 0px; color: #666666; font-family: 宋体, Arial; font-size: 14px; background-color: #eeeeee;\">&nbsp;</p>','',NULL,'38',NULL,0,'690',1480060765072,NULL,NULL,1480060765070,'37'),('83',NULL,'关于召开落实教育工作会议的通知','<p style=\"margin: 0px 20px 0px 0px; padding: 0px 0px 12px; line-height: 30px; overflow: hidden; text-align: justify; word-wrap: break-word; color: #222222; font-family: Arial, 鑴ｈ劍鑴ゆ皳; font-size: 16px;\">关于召开落实教育工作会议的通知</p>\n<p style=\"margin: 0px 20px 0px 0px; padding: 0px 0px 12px; line-height: 30px; overflow: hidden; text-align: justify; word-wrap: break-word; color: #222222; font-family: Arial, 鑴ｈ劍鑴ゆ皳; font-size: 16px;\">　　所属各系办：</p>\n<p style=\"margin: 0px 20px 0px 0px; padding: 0px 0px 12px; line-height: 30px; overflow: hidden; text-align: justify; word-wrap: break-word; color: #222222; font-family: Arial, 鑴ｈ劍鑴ゆ皳; font-size: 16px;\">　　为了总结交流经验，研究分析存在的问题，进一步贯彻落实省、市大力发展科技育人的工作会议精神，做好今年各系工作，经研究决定召开教育工作会议。现将有关事项通知如下：</p>\n<p style=\"margin: 0px 20px 0px 0px; padding: 0px 0px 12px; line-height: 30px; overflow: hidden; text-align: justify; word-wrap: break-word; color: #222222; font-family: Arial, 鑴ｈ劍鑴ゆ皳; font-size: 16px;\">　　会议内容：</p>\n<p style=\"margin: 0px 20px 0px 0px; padding: 0px 0px 12px; line-height: 30px; overflow: hidden; text-align: justify; word-wrap: break-word; color: #222222; font-family: Arial, 鑴ｈ劍鑴ゆ皳; font-size: 16px;\">　　一 1 市教育局<u>领导讲话</u></p>\n<p style=\"margin: 0px 20px 0px 0px; padding: 0px 0px 12px; line-height: 30px; overflow: hidden; text-align: justify; word-wrap: break-word; color: #222222; font-family: Arial, 鑴ｈ劍鑴ゆ皳; font-size: 16px;\">　　2 传达市教育局关于大力发展科技教育精神，落实好各项基本政策. 3学校领导对各部门工作进行具体布置</p>\n<p style=\"margin: 0px 20px 0px 0px; padding: 0px 0px 12px; line-height: 30px; overflow: hidden; text-align: justify; word-wrap: break-word; color: #222222; font-family: Arial, 鑴ｈ劍鑴ゆ皳; font-size: 16px;\">　　二、参加人员：各系全体教师</p>\n<p style=\"margin: 0px 20px 0px 0px; padding: 0px 0px 12px; line-height: 30px; overflow: hidden; text-align: justify; word-wrap: break-word; color: #222222; font-family: Arial, 鑴ｈ劍鑴ゆ皳; font-size: 16px;\">　　三、会议时间：2016年11月25日9：00<br /><br />&nbsp; &nbsp; &nbsp; &nbsp; 地点：学校礼堂报告厅</p>\n<p style=\"margin: 0px 20px 0px 0px; padding: 0px 0px 12px; line-height: 30px; overflow: hidden; text-align: justify; word-wrap: break-word; color: #222222; font-family: Arial, 鑴ｈ劍鑴ゆ皳; font-size: 16px;\">　　四、要求：请全体教师规划好工作后按时参加会议。如有特殊原因，必须向各所属系分管领导请假</p>\n<p style=\"margin: 0px 20px 0px 0px; padding: 0px 0px 12px; line-height: 30px; overflow: hidden; text-align: justify; word-wrap: break-word; color: #222222; font-family: Arial, 鑴ｈ劍鑴ゆ皳; font-size: 16px;\">　　特此通知</p>\n<p style=\"margin: 0px 20px 0px 0px; padding: 0px 0px 12px; line-height: 30px; overflow: hidden; text-align: justify; word-wrap: break-word; color: #222222; font-family: Arial, 鑴ｈ劍鑴ゆ皳; font-size: 16px;\">　　武汉测试学校</p>\n<p style=\"margin: 0px 20px 0px 0px; padding: 0px 0px 12px; line-height: 30px; overflow: hidden; text-align: justify; word-wrap: break-word; color: #222222; font-family: Arial, 鑴ｈ劍鑴ゆ皳; font-size: 16px;\">　　2016年11月25日</p>','',NULL,'37',NULL,0,'690',1480060870465,NULL,NULL,1480060870463,'37'),('84',NULL,'关于我校首届教工大会召开的通知','<p style=\"margin: 0px 20px 0px 0px; padding: 0px 0px 12px; line-height: 30px; overflow: hidden; text-align: justify; word-wrap: break-word; color: #222222; font-family: Arial, 鑴ｈ劍鑴ゆ皳; font-size: 16px;\">全体教工：</p>\n<p style=\"margin: 0px 20px 0px 0px; padding: 0px 0px 12px; line-height: 30px; overflow: hidden; text-align: justify; word-wrap: break-word; color: #222222; font-family: Arial, 鑴ｈ劍鑴ゆ皳; font-size: 16px;\">　　我校首届教工大会将于11月30日召开，本次教工大会的主题是&ldquo;团结一心，克难攻坚，努力开创教育基地新局面&rdquo;。为了开好本届教工大会，现向全体教职工征求提案，要求全体教职工本着对学校负责的态度在学校的管理、发展等方面提出科学、合理、建设性的建议或意见，希望各位教工群策群力，共同谋划学校发展的新蓝图，写出高质量的教工大会提案。为此，提出以下具体要求：</p>\n<p style=\"margin: 0px 20px 0px 0px; padding: 0px 0px 12px; line-height: 30px; overflow: hidden; text-align: justify; word-wrap: break-word; color: #222222; font-family: Arial, 鑴ｈ劍鑴ゆ皳; font-size: 16px;\">　　一、提案者在撰写提案之前应做好深入细致的调研，反映教职工的共同呼声，代表广大教职工的共同利益。</p>\n<p style=\"margin: 0px 20px 0px 0px; padding: 0px 0px 12px; line-height: 30px; overflow: hidden; text-align: justify; word-wrap: break-word; color: #222222; font-family: Arial, 鑴ｈ劍鑴ゆ皳; font-size: 16px;\">　　二、提案要按照大会的指导思想和主要议题，结合学校的实际情况，围绕学校的改革、发展以及教职员工普遍关心的问题，开展调研、分析，并提出实施建议。</p>\n<p style=\"margin: 0px 20px 0px 0px; padding: 0px 0px 12px; line-height: 30px; overflow: hidden; text-align: justify; word-wrap: break-word; color: #222222; font-family: Arial, 鑴ｈ劍鑴ゆ皳; font-size: 16px;\">　　三、提案必须符合党和国家的政策、法律法规，力求切合我校实际，能客观地反映广大教职工的意愿。</p>\n<p style=\"margin: 0px 20px 0px 0px; padding: 0px 0px 12px; line-height: 30px; overflow: hidden; text-align: justify; word-wrap: break-word; color: #222222; font-family: Arial, 鑴ｈ劍鑴ゆ皳; font-size: 16px;\">　　四、使用统一印制下发的提案<u>表格</u>，也可在学校qq群上下载打印。请各位教工将纸质提案交综合科，同时请将文本材料发至教育基地qq群。</p>\n<p style=\"margin: 0px 20px 0px 0px; padding: 0px 0px 12px; line-height: 30px; overflow: hidden; text-align: justify; word-wrap: break-word; color: #222222; font-family: Arial, 鑴ｈ劍鑴ゆ皳; font-size: 16px;\">　　五、提案将提交给校领导批示，并将在下教工大会上给解答。</p>\n<p style=\"margin: 0px 20px 0px 0px; padding: 0px 0px 12px; line-height: 30px; overflow: hidden; text-align: justify; word-wrap: break-word; color: #222222; font-family: Arial, 鑴ｈ劍鑴ゆ皳; font-size: 16px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 武汉测试学校</p>\n<p style=\"margin: 0px 20px 0px 0px; padding: 0px 0px 12px; line-height: 30px; overflow: hidden; text-align: justify; word-wrap: break-word; color: #222222; font-family: Arial, 鑴ｈ劍鑴ゆ皳; font-size: 16px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2016年11月25日</p>','',NULL,'37',NULL,0,'690',1480060966486,NULL,NULL,1480060966484,'37'),('85',NULL,'关于做好教育科研工作的通知','<p><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">&nbsp; &nbsp; &nbsp; 为落实7月19日&ldquo;全市教育科研课题研究专题会议&rdquo;精神，就做好近期两项教育科研工作提出如下要求：</span><br style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" /><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">一、拍照教育科研类牌匾</span><br style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" /><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">为及时了解和积累我市教育科研资料，同时方便编写教育科研画册，要求各校集中拍照教育科研类牌匾。具体要求如下：</span><br style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" /><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">1、类别及照片要求</span><br style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" /><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">&nbsp;&nbsp;&nbsp; 各级教育科研重点研究基地牌匾、某项教育科研课题研究实验学校牌匾、由XX市或XX市教育局颁发的教育科研先进单位牌匾、优质教学研究重点实验学校牌匾和其它教育科研类牌匾都在本次拍照之列。</span><br style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" /><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">牌匾采用正面照的方式，照片须清晰，边框外要留出一定余地，背景要美观、大方、干净。</span><br style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" /><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">2、拍照和传送办法</span><br style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" /><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">校办将本通知于今天下午3点前及时转发至所属各学校。拍照由市直学校、乡镇各校分别进行，由各校将牌匾照片电子底片于今天下午5点前打包（文件夹底部注明某乡镇某学校），直接发至市教科所邮箱，乡镇学校同时发至乡镇校办教科研邮箱。</span><br style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" /><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">各单位电脑中如存有本单位其它教育科研类照片（比如会议类、活动类等），此次也可同时上报。</span><br style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" /><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">二、按时建立课题组博客</span><br style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" /><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">根据全市课题研究专题会议要求，凡在2016年8月新立项的省级和市级课题，每项课题均须在新浪网建立课题组博客，具体要求如下：</span><br style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" /><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">1、建博目的</span><br style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" /><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">方便课题组及时积累研究资料、及时展示研究过程、及时撰写结题资料，同时便于市教科所、各乡镇校办、各学校对各项课题实施过程管理和指导督查，便于各课题组间相互</span><a class=\"keylink\" style=\"color: #595959; text-decoration: none; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" href=\"http://gongwen.1kejian.com/list-64-1.html\" target=\"_blank\">学习</a><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">交流。</span><br style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" /><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">2、名称要求</span><br style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" /><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">博客名要简明扼要。博客名称可以是主持人真实姓名，也可为网名。博客管理员可以是主持人，也可为课题组其他成员。</span><br style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" /><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">3、时间要求</span><br style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" /><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">各课题组博客务于8月28日前建立完成（各乡镇校办教研员和市直学校教科所所长、教科室主任要给予具体指导），各课题组建立博客后，要到&ldquo;禹城教科研&rdquo;博客首页左下方点击&ldquo;加关注&rdquo;报到，并填写本通知附件中的表格，于8月28日上午11点前发至本乡镇校办教研员邮箱（市直学校发至学校教科所、教科室邮箱）。</span><br style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" /><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">4、上传博文</span><br style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" /><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">各课题组务于8月30日前将课题研究实施</span><a class=\"keylink\" style=\"color: #595959; text-decoration: none; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" href=\"http://gongwen.1kejian.com/list-58-1.html\" target=\"_blank\">方案</a><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">撰写完毕，并于8月3日前上传第1篇博文（课题研究实施</span><a class=\"keylink\" style=\"color: #595959; text-decoration: none; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" href=\"http://gongwen.1kejian.com/list-58-1.html\" target=\"_blank\">方案</a><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">）至本课题组博客，各乡镇校办教研员和市直学校教科所所长、教科室主任要给予技术上的指导，并做好督导检查，确保按时完成任务。</span><br style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" /><br style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" /><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">&nbsp;</span><br style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" /><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;武汉测试学校</span><br style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\" /><span style=\"color: #333333; font-family: 微软雅黑, \'Microsoft YaHei\', \'Segoe UI\', Verdana; font-size: 16px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2016年11月25日</span></p>','',NULL,'36',NULL,0,'690',1480061150172,NULL,NULL,1480061150171,'37'),('86',NULL,'武汉测试学校行政党支部召开预备党员转正大会','<p class=\"MsoNormal\" style=\"text-indent: 31.0pt; mso-char-indent-count: 2.0;\"><span style=\"font-family: 宋体;\"><span style=\"font-size: 18.6667px; letter-spacing: 1px;\">2016年11月24日，武汉测试学校党总支下属行政党支部全体党员齐聚一堂，专题召开预备党员焦悦、周一繁转正大会，讨论并通过两位预备党员的转正申请。</span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent: 31.0pt; mso-char-indent-count: 2.0;\"><span style=\"font-family: 宋体;\"><span style=\"font-size: 18.6667px; letter-spacing: 1px;\">在庄严的党旗下，预备党员焦悦、周一繁宣读转正申请；培养人张力、穆洁和张彦薇、李荻分别总结评价申请人焦悦、周一繁一年预备期内的思想、工作和生活表现；行政党支部其他党员就预备党员转正申请、培养人总结评价发表意见，进一步指出两位预备党员的优点与不足，希望两位同志按中国共产党党员标准严格要求自已，做一名让群众信得过的优秀党员。</span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent: 31.0pt; mso-char-indent-count: 2.0;\"><span style=\"font-family: 宋体;\"><span style=\"font-size: 18.6667px; letter-spacing: 1px;\">在预备党员宣读转正申请、培养人总结评价和其他党员发表评议基础上，全体党员投票表决，一致同意焦悦、周一繁两名同志如期转正，成为中国共产党正式党员。</span></span></p>','',NULL,'35',NULL,0,'690',1480071331078,'690',1480071331078,1480071331061,'37'),('87',NULL,'武汉测试学校党总支开展“共产党员献爱心”捐款活动','<h1><span style=\"font-size: 14pt; font-family: 宋体; letter-spacing: 0.75pt;\">&nbsp; &ldquo;七一&rdquo;前后，武汉测试学校党总支下属各支部分别举行<span lang=\"EN-US\">2016</span>年度&ldquo;党旗汇聚爱心，慈善播撒朝阳&rdquo;主题共产党员献爱心捐献活动。活动旨在深入推进&ldquo;两学一做&rdquo;学习教育活动，用实际行动向建党<span lang=\"EN-US\">95</span>周年献礼。</span><span lang=\"EN-US\"><br /> &nbsp; &nbsp; &nbsp; 武汉测试学校党总支下属行政支部开展&ldquo;共产党员献爱心&rdquo;捐款活动。各支部党员慷慨解囊，将爱心款投入捐款箱，以帮助困难党员和困难群众走出困境，体现共产党员扶贫济困、助人为乐优秀品质和奉献精神。值得一提的是，初中入党积极分子满博、王姗姗和普通教师冯淑娟、回杨、赵智英以及保利分校<span lang=\"EN-US\">17</span>名普通教师也参与了本次爱心捐款活动。本次捐款活动所得款项及账目明细已分头上交有关部门，该善款将用于区内助医、助学、助老、助残等爱心项目。</span><span lang=\"EN-US\"><br /> &nbsp;&nbsp;此次爱心捐款活动，是武汉测试学校党总支&ldquo;两学一做&rdquo;学习教育活动的一部分，有效增强了党组织的凝聚力和影响力，树立和维护了共产党员在人民群众中的良好形象，体现了共产党员高度的责任感和密切联系群众的工作作风。</span></h1>','',NULL,'35',NULL,0,'690',1480061608718,NULL,NULL,1480061608716,'37');

UNLOCK TABLES;

/*Table structure for table `oa_notify_column` */

DROP TABLE IF EXISTS `oa_notify_column`;

CREATE TABLE `oa_notify_column` (
  `id` varchar(50) NOT NULL COMMENT '主键ID',
  `name` varchar(255) CHARACTER SET utf32 DEFAULT NULL COMMENT '类型名字',
  `school_id` varchar(50) DEFAULT NULL COMMENT '属于机构ID',
  `status` int(10) DEFAULT NULL COMMENT '状态',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `del_flag` int(10) DEFAULT '0' COMMENT '逻辑删除标记（0：显示；1：隐藏）',
  `create_by` varchar(50) NOT NULL COMMENT '创建者',
  `create_date` bigint(20) NOT NULL COMMENT '创建时间',
  `update_by` varchar(50) DEFAULT NULL COMMENT '更新者',
  `update_date` bigint(20) DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `oa_notify_del_flag` (`del_flag`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='通知通告栏目';

