  `client_secret` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '授权登陆的密钥',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

