/*Table structure for table `sys_app` */

DROP TABLE IF EXISTS `sys_app`;

CREATE TABLE `sys_app` (
  `id` varchar(50) NOT NULL COMMENT '主键ID',
  `name` varchar(255) DEFAULT NULL COMMENT '应用名',
  `icon_url` varchar(1000) DEFAULT NULL COMMENT '图标路径',
  `web_url` varchar(1000) DEFAULT NULL COMMENT '网页路径',
  `pic_url` varchar(1000) DEFAULT NULL COMMENT '介绍图片',
  `app_permission` int(5) DEFAULT NULL COMMENT '应用级别【1；区级应用 2 校级应用 3公共应用】',
  `app_status` int(10) DEFAULT NULL COMMENT '应用状态[0:审核中, 1:已上线, 2:下线, 3:其他异常]',
  `is_default` int(10) DEFAULT '0' COMMENT '是否是默认应用',
  `create_by` varchar(50) NOT NULL COMMENT '创建者',
  `create_date` bigint(20) NOT NULL COMMENT '创建时间',
  `update_by` varchar(50) DEFAULT NULL COMMENT '更新者',
  `update_date` bigint(20) DEFAULT NULL COMMENT '更新时间',
  `remarks` varchar(5000) DEFAULT NULL COMMENT '备注信息',
  `del_flag` int(10) DEFAULT '0' COMMENT '逻辑删除标记（0：显示；1：隐藏）',
  `target_user` varchar(255) DEFAULT NULL COMMENT '目标用户（1：教师，2：学生，3：家长，4：其他）',
  `category` varchar(255) DEFAULT NULL COMMENT '应用类别（1.教学教务；2.互动空间）',
  `developers` varchar(255) DEFAULT NULL COMMENT '开发商',
  `sfczxmz` int(10) DEFAULT '0' COMMENT '是否存在项目中（0：否，1：是）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='应用表';

/*Data for the table `sys_app` */

LOCK TABLES `sys_app` WRITE;

insert  into `sys_app`(`id`,`name`,`icon_url`,`web_url`,`pic_url`,`app_permission`,`app_status`,`is_default`,`create_by`,`create_date`,`update_by`,`update_date`,`remarks`,`del_flag`,`target_user`,`category`,`developers`,`sfczxmz`) values ('1','人事管理','app/detail/201609/1475142163669.png','renshi/renyuan/index','app/detail/201610/1476681933486.png,app/detail/201610/1476681933478.png,app/detail/201610/1476681933468.png,app/detail/201610/1476681933450.png,app/detail/201610/1476681933440.png',2,0,1,'1',1479190291413,NULL,NULL,'<p class=\"MsoNormal\"><span style=\"font-family: 微软雅黑; color: #333333; letter-spacing: 0pt; font-size: 10.5pt;\">人事管理系统的管理内容主要是对学校的教职工基本信息、教职工账号等信息进行切实的管理。同时对学校部门设置管理、职务设置管理等提供入口，满足教学人事管理的日常需求，让繁杂的教职工信息管理变得简单，并为其他系统应用提供人事数据。</span></p>',0,'1','1','教育云平台',1),('12','互动社区','app/detail/201611/1479190668287.png','http://115.28.175.51/testsns/index.php/forum/index/index','',3,0,0,'1',1479191517258,NULL,NULL,'<p class=\"MsoNormal\"><span style=\"mso-spacerun: \'yes\'; font-family: 微软雅黑; font-size: 10.5000pt; mso-font-kerning: 1.0000pt;\"><span style=\"font-family: 微软雅黑;\">互动社区的本质是对信息的接收和传播，学校或者个人可以通过互动社区应用有针性面向一定的群体发布内容，具有范围广、参与人群广和开放性的特点，管理层级分明，规范有序，促进交流，有较强的互动性</span></span></p>',0,'3,2,1','2','教育云平台',1),('13','积分商城','app/detail/201611/1479191137475.png','','',3,0,0,'1',1479191478967,NULL,NULL,'<p class=\"MsoNormal\"><span style=\"font-family: 微软雅黑; font-size: 11pt;\"><span style=\"font-family: 微软雅黑;\">积分是一种用户奖励计划，在积分商城内所有商品都参与积分返利活动。用户可根据获得的积分可以在商城购物中，直接作为现金抵用，用来购买商城内的商品。同时，用户对商品可进行站外分享。</span></span></p>',0,'3,2,1','2','教育云平台',1),('14','活动中心','app/detail/201611/1479191594544.png','','',3,0,1,'1',1479191625412,NULL,NULL,'<p class=\"MsoNormal\"><span style=\"font-family: 微软雅黑; color: #333333; font-size: 10.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: 微软雅黑;\">活动中心平台是通过平台发起活动，绝大部分在平台上进行的活动，也可以选择线下进行活动，是一个先要在平台上发布活动信息，募集活动人员，在平台或者线下上进行活动的流程。活动中心向所有人开放，解决了很多由于人力、物力和时间的约束难以进行的活动也得以通过平台展开，活动中心就是这样一个提供活动相关服务的平台。</span></span></p>',0,'3,2,1','2','教育云平台',1),('15','慕课直播','app/detail/201611/1479191651165.png','http://mooc.gukeer.cc/mooc/ssoLogin/auth','',3,0,0,'1',1479973096581,NULL,NULL,'<p class=\"MsoNormal\"><span style=\"font-family: 微软雅黑; font-size: 11pt;\"><span style=\"font-family: 微软雅黑;\">在线直播平台通过教师在线授课，学生网上学习的方式。教师可以通过白板授课，在白板中进行知识点的注释和讲解，通过公共和私人两种方式和学生交流互动，教师可以实时查看学生参与状态，支持用户同一时间共享多个摄像头，支持上传</span>pdf、word等多种格式文件，实现桌面共享，学生可以在线回答问题，课后可以根据上课情况进行反馈，教师能够通过学生的课堂反馈，直接的了解到学生学习的真正所需，以便教师进行自我反思和调控教学。</span></p>',0,'2,1','1','教育云平台',1),('16','你问我答','app/detail/201611/1479191753232.png','','',3,0,0,'1',1479191817321,NULL,NULL,'<p class=\"MsoNormal\"><span style=\"mso-spacerun: \'yes\'; font-family: 微软雅黑; font-size: 10.5000pt; mso-font-kerning: 0.0000pt;\"><span style=\"font-family: 微软雅黑;\">你问我答平台中，用户可以具有针对性地提出问题，通过其他用户解答的方式，来解决该问题，完成问答过程。同时，这些问题的答案又会进一步作为搜索结果，提供给其他有类似疑问的用户，达到分享知识的效果。你问我答的最大特点，就是让用户所拥有的隐性知识转化成显性知识</span></span><span style=\"mso-spacerun: \'yes\'; font-family: 微软雅黑; font-size: 10.5000pt; mso-font-kerning: 0.0000pt;\"><span style=\"font-family: 微软雅黑;\">，用户既是你问我答内容的使用者，同时又是你问我答的创造者。</span></span></p>',0,'3,2,1','2','教育云平台',1),('17','兴趣群组','app/detail/201611/1479191921557.png','','',3,0,0,'1',1479191942120,NULL,NULL,'<p class=\"MsoNormal\"><span style=\"font-family: 微软雅黑; font-size: 11pt;\"><span style=\"font-family: 微软雅黑;\">群组分为公开和私有两种</span>,加入私有群组需要创建人审核，群成员可邀请好友加入群组。群组成员可以在群组内公开发帖，来实现动态信息内容的共享。群组有讨论、有分享、有成员关系、有人与人之间的沟通。成员是群组最重要的部分，通过互动维系成员联系。</span></p>',0,'3,2,1','2','教育云平台',1),('18','智能穿戴','app/detail/201611/1479191966396.png','','',3,0,0,'1',1487126257437,NULL,NULL,'<p>我也加个评论呗</p>',0,'1','1','教育云平台',1),('19','资讯广场','app/detail/201611/1479192004915.png','','',3,0,0,'1',1479192031007,NULL,NULL,'<p class=\"MsoNormal\"><span style=\"font-family: 微软雅黑; font-size: 11pt;\"><span style=\"font-family: 微软雅黑;\">资讯广场以发布展示资讯内容为主，例如新闻类、文章类、动态等。可以自定义分类，展示全方位的内容信息，校内人员可通过资讯了解学校的动态。对于优质类的内容可进行推荐展示或分享。</span></span></p>',0,'3,2,1','2','教育云平台',1),('1fca23c8f69bbdb6bf7afc9de13a0ccf','人事管理','app/detail/201609/1475142163111.png','area/renyuan/index','',1,0,0,'1',1492135758103,NULL,NULL,'',0,'1','1','',1),('2','学籍管理','app/detail/201609/1475141395501.png','class/index','app/detail/201610/1476675269887.png,app/detail/201610/1476675269864.png,app/detail/201610/1476675269854.png,app/detail/201610/1476675269842.png,app/detail/201610/1476675269832.png,app/detail/201610/1476675269816.png,app/detail/201610/1476675269804.png',2,0,1,'1',1479190430102,NULL,NULL,'<p class=\"MsoNormal\"><span style=\"font-family: 微软雅黑; color: #333333; letter-spacing: 0pt; font-size: 10.5pt;\">学籍管理系统主要对学校学生信息的基础数据进行管理和维护，同时维护学校的部分基础信息，比如学校的学段设置、班级设置、其他基本设置等等。学籍管理系统作为学生基础数据的入口，为学生考勤、成绩分析等等系统提供了基础数据，实现了对整个平台的学生基础数据的统一管理，减少数据维护工作，减少沟通成本，提高了相应的教学教务的工作效率。</span></p>',0,'1','1','教育云平台',1),('20','班级圈','app/detail/201611/1479793232210.png','http://115.28.175.51/testsns/index.php/weibo/index/index','',3,0,0,'1',1487126235205,NULL,NULL,'<p class=\"MsoNormal\"><span style=\"font-family: 微软雅黑; color: #333333; font-size: 10.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: 微软雅黑;\">班级圈是一个<span style=\"color: #333333;\">个基于</span></span></span><span style=\"font-family: 微软雅黑; color: #333333; font-size: 10.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: 微软雅黑;\">用户</span></span><span style=\"font-family: 微软雅黑; color: #333333; font-size: 10.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: 微软雅黑;\">关系信息，</span></span><span style=\"font-family: 微软雅黑; color: #333333; font-size: 10.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: 微软雅黑;\">分享</span></span><span style=\"font-family: 微软雅黑; color: #333333; font-size: 10.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: 微软雅黑;\">、传播以及获取的平台，用户通过在社交圈分享个人的最新动态和每时每刻的所见所闻，并且能够通过相互关注的方式实现用户之间的交流和社交，具有实时性和快捷性的特点，深受用户喜爱。</span></span></p>',0,'3,2,1','2','教育云平台',1),('3','应用商店','app/detail/201609/1475142456413.png','app/appstore/index','app/detail/201610/1476683805438.png,app/detail/201610/1476683805416.png,app/detail/201610/1476683805407.png',3,0,0,'1',1479190601359,NULL,NULL,'<p class=\"MsoNormal\"><span style=\"font-family: 微软雅黑; color: #333333; letter-spacing: 0pt; font-size: 10.5pt;\">应用商店是一个开放的应用生态圈，可以利用全接口整合第三方应用，学校可以根据其个性化需求在应用商店中选择实际需要的应用，同时商店中的应用会持续更新，满足学校日后对应用的需求，促进学校的长远发展。</span></p>',0,'3,2,1','2','教育云平台',1),('4','通讯录','app/detail/201609/1475139465580.png','contact/contact/index','app/detail/201609/1475139775314.png',3,0,0,'1',1479190409746,NULL,NULL,'<p class=\"MsoNormal\"><span style=\"font-family: 微软雅黑; color: #333333; letter-spacing: 0pt; font-size: 10.5pt;\">通讯录作为平台的基础功能，同步人事管理中的部门管理的教职工通讯信息，方便学校内部查询相关教职工信息，便于管理和使用。</span></p>',0,'1','1','教育云平台',1),('5','通知公告','app/detail/201609/1475142634153.png','notify/index','app/detail/201610/1476688169684.png,app/detail/201610/1476688169674.png,app/detail/201610/1476688169667.png,app/detail/201610/1476688169653.png',3,0,0,'1',1479190510494,NULL,NULL,'<p class=\"MsoNormal\"><span style=\"font-family: 微软雅黑; color: #333333; letter-spacing: 0pt; font-size: 10.5pt;\">通知公告主要面向教职工，对于校内的各类通知的发布，均可以通过通知公告应用来实现，并且对发布内容以及通告栏目有明确的管理人员和制度，对通知的发布做到严格控制。</span></p>',0,'1','1','教育云平台',1),('5499b97c06adf875c22c7c1e1f6cdf72','教务管理','app/detail/201609/1475142163699.png','teach/task/room/index','',2,0,0,'1',1492156911727,NULL,NULL,'',0,'4,3,2,1','1','',1),('6','阳光分班','app/detail/201610/1476699968952.png','','app/detail/201610/1476688618304.png,app/detail/201610/1476688618299.png,app/detail/201610/1476688618294.png',3,0,0,'1',1479190639391,NULL,NULL,'<p class=\"MsoNormal\"><span style=\"mso-spacerun: \'yes\'; font-family: 微软雅黑; font-size: 10.5000pt; mso-font-kerning: 1.0000pt;\">阳光分班系统通过分班自动化、公开化的操作，实现均衡搭配，智能分班的理念。以分班数据的随机分配原则，为用户提供多种分班条件的配置，满足不同分班需求，真正实现阳光分班。</span></p>',0,'1','1','教育云平台',1),('d86b3f2ca6f25ffd772332be2e6d65df','学籍管理','app/detail/201609/1475142163222.png','area/class/stuinfo/index','app/detail/201704/1491459270213.jpg,app/detail/201704/1491459266897.jpg,app/detail/201704/1491459263571.jpg',1,1,0,'1',1492135779456,NULL,NULL,'',0,'1','1','',1);

